        n = len(matrix)
        m = len(matrix[0])
        changes = 0
        for i in range(n):
            for j in range(m):
                if matrix[i][j] != matrix[i][j]:
                    changes += 1
        return changes

    def find_min_changes(matrix):
        n = len(matrix)
        m = len(matrix[0])
        min_changes = float('inf')
        for i in range(1 << n):
            temp_matrix = [row[:] for row in matrix]
            changes = 0
            for j in range(n):
                if (i >> j) & 1:
                    temp_matrix[j][0] = 1 - temp_matrix[j][0]
                    changes += 1
            min_changes = min(min_changes, changes)
        return min_changes

    print(find_min_changes(matrix))

