            elif move == 2:
                current_room = senior_config[current_room - 1][1]
            elif move == 3:
                current_room = senior_config[current_room - 1][2]
            elif move == 4:
                current_room = senior_config[current_room - 1][3]
            else:
                return False
        return current_room == n

