    for _ in range(n - 1):
        u, v = map(int, input().split())
        edges.append((u, v))

    adj = [[] for _ in range(n)]
    for u, v in edges:
        adj[u - 1].append(v - 1)
        adj[v - 1].append(u - 1)

    def check(arr):
        for i in range(n):
            for j in range(i + 1, n):
                if arr[i] == arr[j]:
                    return False
        return True

    def solve_recursive(arr, visited, current_path):
        if len(current_path) == n:
            if check(arr):
                return True
            else:
                return False

        for i in range(n):
            if i not in visited:
                new_arr = arr[:]
                new_arr[i] = current_path[i]
                if solve_recursive(new_arr, visited | {i}, current_path + [i]):
                    return True
        return False

    def solve_iterative(arr):
        for i in range(n):
            if arr[i] == 0:
                arr[i] = 1
                if solve_iterative(arr):
                    return True
                arr[i] = 0
        return False

    arr = [0] * n
    if solve_recursive(arr, set(), []):
        print("YES")
        for x, y in zip(arr, arr):
            print(x, y)
    else:
        print("NO")

