    for _ in range(n - 1):
        u, v = map(int, input().split())
        edges.append((u, v))

    adj = [[] for _ in range(n + 1)]
    for u, v in edges:
        adj[u].append(v)
        adj[v].append(u)

    def find_path(start, end, path):
        if start == end:
            return path
        for neighbor in adj[start]:
            if neighbor not in path:
                new_path = find_path(neighbor, end, path + [neighbor])
                if new_path:
                    return new_path
        return None

    def find_common_path(start1, end1, start2, end2):
        path1 = find_path(start1, end1, [])
        path2 = find_path(start2, end2, [])
        if not path1 or not path2:
            return []
        common = []
        i = 0
        j = 0
        while i < len(path1) and j < len(path2):
            if path1[i] == path2[j]:
                common.append(path1[i])
                i += 1
                j += 1
            elif path1[i] < path2[j]:
                i += 1
            else:
                j += 1
        return common

    def find_max_common_and_length(start1, end1, start2, end2):
        common = find_common_path(start1, end1, start2, end2)
        if not common:
            return 0, []
        max_common = 0
        max_common_path = []
        for i in range(1, len(common)):
            sub_common = common[:i]
            length = len(sub_common)
            if length > max_common:
                max_common = length
                max_common_path = sub_common
            elif length == max_common:
                if sub_common not in max_common_path:
                    max_common_path.append(sub_common)
        return max_common, max_common_path

    max_common, max_common_path = find_max_common_and_length(1, n, 2, n)
