def solve_interval(a, b):
    if a == b:
        return 1
    if a > b:
        return 0

    count = 0
    i = 1
    while i * i <= a:
        if a % i == 0:
            if i * i <= a:
                count += 1
            if a // i * i <= a:
                count += 1
        i += 1

    return count

