    r, c = map(int, input().split())
    bed, fridge = map(int, input().split())
    grid = []
    for _ in range(r):
        grid.append(input())

    p = int(input())
    masters = []
    for _ in range(p):
        masters.append(tuple(map(int, input().split())))

    def is_valid_move(x, y):
        return 1 <= x <= r and 1 <= y <= c and grid[x-1][y-1] == '.'

    def is_blocked(x, y):
        return grid[x-1][y-1] == '#'

    def is_child(x, y):
        return x == bed and y == fridge

    def is_master(x, y):
        return x in [m[0] for m in masters] and y in [m[1] for m in masters]

    def is_path_blocked(x, y):
        for m in masters:
            if is_valid_move(x, y) and is_valid_move(m[0], m[1]) and not is_blocked(x, y) and not is_blocked(m[0], m[1]):
                return True
        return False

    def bfs(start_x, start_y):
        queue = [(start_x, start_y, 0)]
        visited = {(start_x, start_y)}

        while queue:
            x, y, turns = queue.pop(0)

            if is_child(x, y):
                return turns

            for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
                new_x, new_y = x + dx, y + dy

                if is_valid_move(new_x, new_y) and not is_blocked(new_x, new_y) and (new_x, new_y) not in visited:
                    queue.append((new_x, new_y, turns + 1))
                    visited.add((new_x, new_y))

        return float('inf')

    print(bfs(bed, fridge))

