    for _ in range(2 * (n - 1)):
        u, v = map(int, input().split())
        edges.append((u, v))

    def is_valid_assignment(edges):
        left_tree = []
        right_tree = []
        for u, v in edges:
            if u < v:
                left_tree.append((u, v))
            else:
                right_tree.append((u, v))

        def is_valid_subtree(subtree):
            if not subtree:
                return True

            for i in range(len(subtree) - 1):
                u, v = subtree[i], subtree[i + 1]
                if u > v:
                    return False
            return True

        def is_valid_tree(subtree):
            if not subtree:
                return True

            for i in range(len(subtree) - 1):
                u, v = subtree[i], subtree[i + 1]
                if u < v:
                    return False
            return True

        left_tree_valid = is_valid_subtree(left_tree)
        right_tree_valid = is_valid_subtree(right_tree)

        if not left_tree_valid or not right_tree_valid:
            return False

        left_tree_sorted = sorted(left_tree, key=lambda x: x[0])
        right_tree_sorted = sorted(right_tree, key=lambda x: x[0])

        if left_tree_sorted != left_tree:
            return False
        if right_tree_sorted != right_tree:
            return False

        return True

    def find_assignment(edges):
        for i in range(1 << (2 * (n - 1))):
            assignment = []
            for j in range(2 * (n - 1)):
                if (i >> j) & 1:
                    assignment.append("L")
                else:
                    assignment.append("R")

            if is_valid_assignment(assignment):
                return assignment

        return None

    assignment = find_assignment(edges)
    if assignment:
        print("".join(assignment))
    else:
        print("impossible")

