        distance = 0
        for move in path:
            if move == 'R':
                distance += 1
            else:
                distance += 1
        return distance

    def generate_paths(index, current_path, visited):
        if index == n:
            return [current_path]

        paths = []
        for i in range(n):
            if i not in visited:
                new_visited = visited.copy()
                new_visited.add(i)
                new_path = current_path + [packages[i]]
                paths.extend(generate_paths(index + 1, new_path, new_visited))

        return paths

    def find_shortest_path():
        paths = generate_paths(0, [], set())
        shortest_paths = []
        for path in paths:
            distance = calculate_distance(path)
            if not shortest_paths or distance < shortest_paths[0][1]:
                shortest_paths = [(path, distance)]
            elif distance == shortest_paths[0][1]:
                shortest_paths.append((path, distance))

        shortest_paths.sort(key=lambda x: x[0])
        return shortest_paths[0]

    shortest_path = find_shortest_path()
    if shortest_path:
        print("YES")
        print("".join(shortest_path[0]))
