        if subsequence in dp:
            return dp[subsequence]

        cost = 0
        for char in subsequence:
            cost += s.count(char)

        dp[subsequence] = cost
        return cost

    def find_subsequences(length):
        if length == 0:
            return []

        subsequences = []
        for i in range(length):
            subsequence = s[:i] + s[i+1:]
            subsequences.extend(find_subsequences(length - 1))

        return subsequences

    subsequences = find_subsequences(n)

    min_cost = float('inf')

    for subsequence in subsequences:
        cost = calculate_cost(subsequence)
        if cost <= k:
            min_cost = min(min_cost, cost)

    if min_cost == float('inf'):
        print(-1)
    else:
        print(min_cost)

solve()

